import { Header } from "../../components/header/header"
import "./routePage.scss"
import { useEffect, useState } from "react"
import { ProfileModal } from "../../components/profileModal/profileModal"
import array from "../../array.js"
export const RoutePage = ({
  profileModal,
  setProfileModal,
  textProfileModalActive,
  setTextProfileModalActive,
  routeUser,
}) => {
  const [routes, setRoutes] = useState([])
  const routeUserRoutePage = () => {
    const startIndex = routeUser.start
    const endIndex = routeUser.end
    const arrayLength = array.length

    // 1. Прямой маршрут (по часовой стрелке)
    let forwardData = []
    let forwardSteps = 0
    let current = startIndex

    while (current !== endIndex) {
      forwardData.push(...array[current].slice(1))
      current = (current + 1) % arrayLength
      forwardSteps++
    }

    // 2. Обратный маршрут (против часовой стрелки)
    let backwardData = []
    let backwardSteps = 0
    current = startIndex

    while (current !== endIndex) {
      current = (current - 1 + arrayLength) % arrayLength
      backwardData.push(...[...array[current].slice(1)].reverse()) // reverse: от end к start
      backwardSteps++
    }

    const startName = array[startIndex][0].start
    const endName = array[endIndex][0].start

    // 3. Сравнение по количеству шагов (корпусов)
    const chosen =
      forwardSteps <= backwardSteps
        ? {
            direction: "Прямой маршрут",
            from: startName,
            to: endName,
            data: forwardData,
          }
        : {
            direction: "Обратный маршрут",
            from: startName,
            to: endName,
            data: backwardData,
          }

    return [chosen]
  }
  useEffect(() => {
    if (routeUser?.start != null && routeUser?.end != null) {
      const newRoutes = routeUserRoutePage()
      setRoutes(newRoutes)
    }
  }, [routeUser])

  return (
    <div className="routeePage">
      <Header setProfileModal={setProfileModal} />
      <div className="titleRoutePage">Ваш маршрут</div>
      <div className="blockRoutePage">
        {routes.map((route, i) => (
          <div key={i}>
            <div className="fromToTextRoutePage">
              <svg
                width="41"
                height="41"
                viewBox="0 0 41 41"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  d="M20.5001 22.9429C23.4437 22.9429 25.8301 20.5566 25.8301 17.6129C25.8301 14.6692 23.4437 12.2829 20.5001 12.2829C17.5564 12.2829 15.1701 14.6692 15.1701 17.6129C15.1701 20.5566 17.5564 22.9429 20.5001 22.9429Z"
                  stroke="#292D32"
                  stroke-width="3"
                />
                <path
                  d="M6.18424 14.5037C9.54966 -0.290454 31.4676 -0.27337 34.8159 14.5208C36.7805 23.1991 31.3822 30.545 26.6501 35.0891C23.2163 38.4033 17.7838 38.4033 14.333 35.0891C9.61799 30.545 4.21966 23.182 6.18424 14.5037Z"
                  stroke="#292D32"
                  stroke-width="3"
                />
              </svg>{" "}
              {route.from}
            </div>
            {route.data.map((place, index) => (
              <div className="BlockRoutePage" key={index}>
                <div className="titlePlaceRoutePage">• {place.address}</div>
              </div>
            ))}
            <div className="fromToTextRoutePage">
              <svg
                width="38"
                height="38"
                viewBox="0 0 38 38"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  d="M20.5001 22.9429C23.4437 22.9429 25.8301 20.5566 25.8301 17.6129C25.8301 14.6692 23.4437 12.2829 20.5001 12.2829C17.5564 12.2829 15.1701 14.6692 15.1701 17.6129C15.1701 20.5566 17.5564 22.9429 20.5001 22.9429Z"
                  stroke="#292D32"
                  stroke-width="3"
                />
                <path
                  d="M6.18424 14.5037C9.54966 -0.290454 31.4676 -0.27337 34.8159 14.5208C36.7805 23.1991 31.3822 30.545 26.6501 35.0891C23.2163 38.4033 17.7838 38.4033 14.333 35.0891C9.61799 30.545 4.21966 23.182 6.18424 14.5037Z"
                  stroke="#292D32"
                  stroke-width="3"
                />
              </svg>{" "}
              {route.to}
            </div>
          </div>
        ))}
      </div>
      {profileModal && (
        <div className="profileModalRoutesPage">
          <ProfileModal
            textProfileModalActive={textProfileModalActive}
            setTextProfileModalActive={setTextProfileModalActive}
          />
        </div>
      )}
    </div>
  )
}
